oga:settings.oga:property:
var reportTitleParamInfo = {
	"id": "reportTitle",
	"title": "Report Title",
	"def": "Consonants",
	"prompt": "Enter report title"
};
var reportTitleParam;
var reportTitle = reportTitleParamInfo.def;

var combineParticipantsParamInfo = {
	"id": "combineParticipants",
	"title": "Combine results",
	"desc": "Combine results for all selected participants",
	"def": false
};
var combineParticipantsParam;
var combineParticipants = combineParticipantsParamInfo.def;

var GroupFilter = require("lib/GroupFilter").GroupFilter;
var AlignedGroupFilter = require("lib/TierFilter").TierFilter;
var WordFilter = require("lib/WordFilter").WordFilter;
var TierList = require("lib/TierList").TierList;
var AlignedWordFilter = require("lib/TierFilter").TierFilter;
var PatternFilter = require("lib/PatternFilter").PatternFilter;
var PatternType = require("lib/PatternFilter").PatternType;
var ResultType = require("lib/PhonScriptConstants").ResultType;

/********************************
 * Setup params
 *******************************/

var filters = {
	"targetResultFilter": new PatternFilter("filters.targetResultFilter"),
	"actualResultFilter": new PatternFilter("filters.actualResultFilter"),
	"group": new GroupFilter("filters.group"),
	"groupTiers": new TierList("filters.groupTiers"),
	"groupPattern": new PatternFilter("filters.groupPattern"),
	"alignedGroup": new AlignedGroupFilter("filters.alignedGroup"),
	"word": new WordFilter("filters.word"),
	"wordTiers": new TierList("filters.wordTiers"),
	"wordPattern": new PatternFilter("filters.wordPattern"),
	"alignedWord": new AlignedWordFilter("filters.alignedWord"),
};

var clusterTypeParamInfo = {
	"ids": [ "includeSingletonOnsets", "includeSingletonCodas", "includeSingletonOEHS",
		    "includeTautosyllabicOnsets", "includeTautosyllabicCodas", "includeHeterosyllabicClusters" ],
	"labels": [ "Singleton Onsets",
			 "Singleton Codas",
			 "Singleton OEHS",
			 "Syllable-initial Clusters (including appendices)",
			 "Syllable-final Clusters (including appendices)",
			 "Heterosyllabic clusters" ], 
	"desc": "Cluster types",
	"defs": [ true, true, true, true, true, true ],
	"cols": 1
};
var clusterTypeParam;

function setup_params(params) {
	reportTitleParam = new StringScriptParam(
		reportTitleParamInfo.id,
		reportTitleParamInfo.title,
		reportTitleParamInfo.def);
	reportTitleParam.setPrompt(reportTitleParamInfo.prompt);
	params.add(0, reportTitleParam);

	combineParticipantsParam = new BooleanScriptParam(
		combineParticipantsParamInfo.id,
		combineParticipantsParamInfo.desc,
		combineParticipantsParamInfo.title,
		combineParticipantsParamInfo.def);
	params.add(combineParticipantsParam);

	clusterTypeParam = new MultiboolScriptParam(
		clusterTypeParamInfo.ids,
		clusterTypeParamInfo.defs,
		clusterTypeParamInfo.labels,
		clusterTypeParamInfo.desc,
		clusterTypeParamInfo.cols);
	params.add(2, clusterTypeParam);

	var optionsSep = new SeparatorScriptParam("Options", false);
	params.add(2, optionsSep);

	// setup result filter section
	var resultFilterSection = new SeparatorScriptParam("Aligned Phones", true);
	var targetLbl = new LabelScriptParam("", "<html><b>IPA Target Matcher</b></html>");
	var actualLbl = new LabelScriptParam("", "<html><b>IPA Actual Matcher</b></html>");

	params.add(resultFilterSection);
	params.add(targetLbl);
	filters.targetResultFilter.setSelectedPatternType(PatternType.PHONEX);
	filters.targetResultFilter.param_setup(params);
	params.add(actualLbl);
	filters.actualResultFilter.setSelectedPatternType(PatternType.PHONEX);
	filters.actualResultFilter.param_setup(params);

	filters.group.param_setup(params);
	filters.groupPattern.param_setup(params);

	var sep2 = new LabelScriptParam("", "<html><b>Aligned Group Filter</b></html>");
	params.add(sep2);
	filters.alignedGroup.param_setup(params);

	filters.word.searchByWordEnabled = false;
	filters.word.param_setup(params);
	filters.wordPattern.param_setup(params);
	filters.wordPattern.setEnabled(false);

	var wordsep2 = new LabelScriptParam("", "<html><b>Aligned Word Filter</b></html>");
	params.add(wordsep2);
	filters.alignedWord.param_setup(params);

	var otherDataHeader = new SeparatorScriptParam("otherDataHeader", "Additional Tier Data", true);
	params.add(otherDataHeader);
	var sep = new LabelScriptParam("", "<html><b>Add aligned groups</b></html>");
	params.add(sep);
	filters.groupTiers.param_setup(params);
	var wordsep = new LabelScriptParam("", "<html><b>Add aligned words</b></html>");
	params.add(wordsep);
	filters.wordTiers.param_setup(params);
}

script.param:
// Singleton Onsets
// The double pipe operator will combine results of independent expressions
// Standalone Onsets
(?<^\s?)(\c:O:E)$ || 
// All other Singleton Onsets
(?<\S)(\c:O)(?>\v)

oga:settings.oga:property:
/*
params = {label, "Add a new column to the input table using javascript.", "<html><b>Add column to table</b></html>"}
;
*/

function getRowValue(table, row) {
	return new String("Singleton Onset");
}

script.param:
// Singleton Codas
// The double pipe operator will combine results of independent expressions
// Medial Singleton Codas
(?<\v)(\c:C)(?>\s? (\c:O | \v)) ||
// Final Singleton Codas
(?<\v)(\c:C)$

oga:settings.oga:property:
/*
params = {label, "Add a new column to the input table using javascript.", "<html><b>Add column to table</b></html>"}
;
*/

function getRowValue(table, row) {
	return new String("Singleton Coda");
}

/*
params = {label, "Add a new column to the input table using javascript.", "<html><b>Add column to table</b></html>"}
;
*/

function getRowValue(table, row) {
	return new String("Singleton OEHS");
}

script.param:
// Syllable-initial Clusters
// Includes left appendices ':L', onsets ':O' and OEHS ':E'
(?<^\s?)(\c:L:O:E<2,>) ||
(?<\v\s?)(\c:L:O:E<2,>)

oga:settings.oga:property:
/*
params = {label, "Add a new column to the input table using javascript.", "<html><b>Add column to table</b></html>"}
;
*/

function getRowValue(table, row) {
	return new String("Syllable-initial Cluster");
}

script.param:
// Syllable-final Clusters
// Includes right appendices ':R' and codas ':C'
(\c:C:R<2,>)$ ||
(\c:C:R<2,>)(?>\s?\c:O)

oga:settings.oga:property:
/*
params = {label, "Add a new column to the input table using javascript.", "<html><b>Add column to table</b></html>"}
;
*/

function getRowValue(table, row) {
	return new String("Syllable-final Cluster");
}

script.param:
// Heterosyllabic Consonant Clusters
// match one or more consonants '\c+'
\c+
// followed by a syllable boundary '\S' (includes implicit boundaries)
\S
// followed by one or more consonants '\c+'
\c+

oga:settings.oga:property:
/*
params = {label, "Add a new column to the input table using javascript.", "<html><b>Add column to table</b></html>"}
;
*/

function getRowValue(table, row) {
	return new String("Heterosyllabic Cluster");
}

function init(inputs, outputs) {
	inputs.add("table", "");
	outputs.add("includeEpenthesis", "", false, java.lang.Boolean);
}

function run(context) {
	var table = context.get("table");

	var count = table.getValueAt(table.rowCount-1, "Count");
	context.put("includeEpenthesis", count > 0);
}

function init(inputs, outputs) {
	inputs.add("singletonsTable", "", false, false);
	inputs.add("clustersTable", "", false, false);

	outputs.add("outputTable", "", false, DefaultTableDataSource);
}

function run(context) {
	var singletonsTable = context.get("singletonsTable");
	var clustersTable = context.get("clustersTable");

	var outputTable = new DefaultTableDataSource();
	var col = 0;
	outputTable.setColumnTitle(col++, "Phone");
	outputTable.setColumnTitle(col++, "Position");
	outputTable.setColumnTitle(col++, "Count");
	outputTable.setColumnTitle(col++, "Accurate");
	outputTable.setColumnTitle(col++, "Substitutions");
	outputTable.setColumnTitle(col++, "Deletions");
	outputTable.setColumnTitle(col++, "Epenthesis");

	var clustersIPATargetCol = 
		clustersTable.getColumnIndex("Phone");
	var clustersPositionCol =
		clustersTable.getColumnIndex("Position");
	var clustersCountCol = 
		clustersTable.getColumnIndex("Count");
	var clustersAccurateCol =
		clustersTable.getColumnIndex("Accurate");
	var clustersSubstitutionsCol =
		clustersTable.getColumnIndex("Substitutions");
	var clustersDeletionsCol =
		clustersTable.getColumnIndex("Deletions");
	var clustersEpenthesisCol = 
		clustersTable.getColumnIndex("Epenthesis");

	var keyCols = [ clustersIPATargetCol, clustersPositionCol ];

	var processedKeys = new java.util.ArrayList();
	for(var row = 0; row < singletonsTable.rowCount-2; row++) {
		var phone = singletonsTable.getValueAt(row, "Phone");
		var position = singletonsTable.getValueAt(row, "Position");
		var count = singletonsTable.getValueAt(row, "Count").intValue();
		var accurate = singletonsTable.getValueAt(row, "Accurate").intValue();
		var subs = singletonsTable.getValueAt(row, "Substitutions").intValue();
		var deletions = singletonsTable.getValueAt(row, "Deletions").intValue();
		var epenthesis = 0;

		var keyVals = [ phone.toString(), position ];

		var clusterRows = clustersTable.findRows(keyCols, keyVals);
		for(var i = 0; i < clusterRows.size(); i++) {
			var clusterRow = clusterRows.get(i);

			var clusterCount = clusterRow[clustersCountCol];
			if(clusterCount != null)
				count = count + clusterCount.intValue();

			var clusterAccurate = clusterRow[clustersAccurateCol];
			if(clusterAccurate != null)
				accurate = accurate + clusterAccurate.intValue();

			var clusterSubstitutions = clusterRow[clustersSubstitutionsCol];
			if(clusterSubstitutions != null)
				subs = subs + clusterSubstitutions.intValue();

			var clusterDeletions = clusterRow[clustersDeletionsCol];
			if(clusterDeletions != null)
				deletions = deletions + clusterDeletions.intValue();

			var clusterEpenthesis = clusterRow[clustersEpenthesisCol];
			if(clusterEpenthesis != null)
				epenthesis = epenthesis + clusterEpenthesis.intValue();
		}

		var rowData = [];
		col = 0;
		rowData[col++] = phone;
		rowData[col++] = position;
		rowData[col++] = count;
		rowData[col++] = accurate;
		rowData[col++] = subs;
		rowData[col++] = deletions;
		rowData[col++] = epenthesis;
		outputTable.addRow(rowData);

		var keyTuple = new Packages.ca.phon.util.Tuple(phone.toString(), position);
		processedKeys.add(keyTuple);
	}

	// add remaining cluster info
	for(var row = 0; row < clustersTable.rowCount-2; row++) {
		var phone = clustersTable.getValueAt(row, "Phone");
		var position = clustersTable.getValueAt(row, "Position");

		var keyVals = [ phone.toString(), position ];
		var keyTuple = new Packages.ca.phon.util.Tuple(phone.toString(), position);
		if(!processedKeys.contains(keyTuple)) {
			var count = 0;
			var accurate = 0;
			var subs = 0;
			var deletions = 0;
			var epenthesis = 0;

			var clusterRows = clustersTable.findRows(keyCols, keyVals);
			for(var i = 0; i < clusterRows.size(); i++) {
				var clusterRow = clusterRows.get(i);

				var clusterCount = clusterRow[clustersCountCol];
				if(clusterCount != null)
					count = count + clusterCount.intValue();

				var clusterAccurate = clusterRow[clustersAccurateCol];
				if(clusterAccurate != null)
					accurate = accurate + clusterAccurate.intValue();

				var clusterSubstitutions = clusterRow[clustersSubstitutionsCol];
				if(clusterSubstitutions != null)
					subs = subs + clusterSubstitutions.intValue();

				var clusterDeletions = clusterRow[clustersDeletionsCol];
				if(clusterDeletions != null)
					deletions = deletions + clusterDeletions.intValue();

				var clusterEpenthesis = clusterRow[clustersEpenthesisCol];
				if(clusterEpenthesis != null)
					epenthesis = epenthesis + clusterEpenthesis.intValue();
			}

			var rowData = [];
			col = 0;
			rowData[col++] = phone;
			rowData[col++] = position;
			rowData[col++] = count;
			rowData[col++] = accurate;
			rowData[col++] = subs;
			rowData[col++] = deletions;
			rowData[col++] = epenthesis;
			outputTable.addRow(rowData);

			processedKeys.add(keyTuple);
		}
	}

	context.put("outputTable", outputTable);
}
